#[doc = " - if (and only if) src/dst is a device, then src/dst won't be auto-incremented."]
#[doc = " - the kernel uses DMAMOV instead of DMAADNH, when having to decrement (possibly working around an erratum);"]
#[doc = " this forces all loops to be unrolled -- you need to keep that in mind when using negative increments, as the kernel"]
#[doc = " uses a limit of 100 DMA instruction bytes per channel."]
#[repr(C)]
#[derive(Debug, Copy, Clone)]
pub struct DmaDeviceConfig {
    #[doc = "< DMA device ID."]
    pub deviceId: s8,
    #[doc = "< Mask of allowed access alignments (8, 4, 2, 1)."]
    pub allowedAlignments: s8,
    #[doc = "< Number of bytes transferred in a burst loop. Can be 0 (in which case the max allowed alignment is used as unit)."]
    pub burstSize: s16,
    #[doc = "< Number of bytes transferred in a \"transfer\" loop (made of burst loops)."]
    pub transferSize: s16,
    #[doc = "< Burst loop stride, can be <= 0."]
    pub burstStride: s16,
    #[doc = "< \"Transfer\" loop stride, can be <= 0."]
    pub transferStride: s16,
}
#[test]
fn bindgen_test_layout_DmaDeviceConfig() {
    assert_eq!(
        crate::mem::size_of::<DmaDeviceConfig>(),
        10usize,
        concat!("Size of: ", stringify!(DmaDeviceConfig))
    );
    assert_eq!(
        crate::mem::align_of::<DmaDeviceConfig>(),
        2usize,
        concat!("Alignment of ", stringify!(DmaDeviceConfig))
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<DmaDeviceConfig>())).deviceId as *const _ as usize },
        0usize,
        concat!(
            "Offset of field: ",
            stringify!(DmaDeviceConfig),
            "::",
            stringify!(deviceId)
        )
    );
    assert_eq!(
        unsafe {
            &(*(crate::ptr::null::<DmaDeviceConfig>())).allowedAlignments as *const _ as usize
        },
        1usize,
        concat!(
            "Offset of field: ",
            stringify!(DmaDeviceConfig),
            "::",
            stringify!(allowedAlignments)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<DmaDeviceConfig>())).burstSize as *const _ as usize },
        2usize,
        concat!(
            "Offset of field: ",
            stringify!(DmaDeviceConfig),
            "::",
            stringify!(burstSize)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<DmaDeviceConfig>())).transferSize as *const _ as usize },
        4usize,
        concat!(
            "Offset of field: ",
            stringify!(DmaDeviceConfig),
            "::",
            stringify!(transferSize)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<DmaDeviceConfig>())).burstStride as *const _ as usize },
        6usize,
        concat!(
            "Offset of field: ",
            stringify!(DmaDeviceConfig),
            "::",
            stringify!(burstStride)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<DmaDeviceConfig>())).transferStride as *const _ as usize },
        8usize,
        concat!(
            "Offset of field: ",
            stringify!(DmaDeviceConfig),
            "::",
            stringify!(transferStride)
        )
    );
}
