#[test]
fn bindgen_test_layout_GSPGPU_FramebufferInfo() {
    assert_eq!(
        crate::mem::size_of::<GSPGPU_FramebufferInfo>(),
        28usize,
        concat!("Size of: ", stringify!(GSPGPU_FramebufferInfo))
    );
    assert_eq!(
        crate::mem::align_of::<GSPGPU_FramebufferInfo>(),
        4usize,
        concat!("Alignment of ", stringify!(GSPGPU_FramebufferInfo))
    );
    assert_eq!(
        unsafe {
            &(*(crate::ptr::null::<GSPGPU_FramebufferInfo>())).active_framebuf as *const _ as usize
        },
        0usize,
        concat!(
            "Offset of field: ",
            stringify!(GSPGPU_FramebufferInfo),
            "::",
            stringify!(active_framebuf)
        )
    );
    assert_eq!(
        unsafe {
            &(*(crate::ptr::null::<GSPGPU_FramebufferInfo>())).framebuf0_vaddr as *const _ as usize
        },
        4usize,
        concat!(
            "Offset of field: ",
            stringify!(GSPGPU_FramebufferInfo),
            "::",
            stringify!(framebuf0_vaddr)
        )
    );
    assert_eq!(
        unsafe {
            &(*(crate::ptr::null::<GSPGPU_FramebufferInfo>())).framebuf1_vaddr as *const _ as usize
        },
        8usize,
        concat!(
            "Offset of field: ",
            stringify!(GSPGPU_FramebufferInfo),
            "::",
            stringify!(framebuf1_vaddr)
        )
    );
    assert_eq!(
        unsafe {
            &(*(crate::ptr::null::<GSPGPU_FramebufferInfo>())).framebuf_widthbytesize as *const _
                as usize
        },
        12usize,
        concat!(
            "Offset of field: ",
            stringify!(GSPGPU_FramebufferInfo),
            "::",
            stringify!(framebuf_widthbytesize)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<GSPGPU_FramebufferInfo>())).format as *const _ as usize },
        16usize,
        concat!(
            "Offset of field: ",
            stringify!(GSPGPU_FramebufferInfo),
            "::",
            stringify!(format)
        )
    );
    assert_eq!(
        unsafe {
            &(*(crate::ptr::null::<GSPGPU_FramebufferInfo>())).framebuf_dispselect as *const _
                as usize
        },
        20usize,
        concat!(
            "Offset of field: ",
            stringify!(GSPGPU_FramebufferInfo),
            "::",
            stringify!(framebuf_dispselect)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<GSPGPU_FramebufferInfo>())).unk as *const _ as usize },
        24usize,
        concat!(
            "Offset of field: ",
            stringify!(GSPGPU_FramebufferInfo),
            "::",
            stringify!(unk)
        )
    );
}
