#[doc = " Struct to contain the data for connecting to a Wifi network from a stored slot."]
#[repr(C)]
#[derive(Copy, Clone)]
pub struct acuConfig {
    pub reserved: [u8_; 512usize],
}
#[test]
fn bindgen_test_layout_acuConfig() {
    assert_eq!(
        crate::mem::size_of::<acuConfig>(),
        512usize,
        concat!("Size of: ", stringify!(acuConfig))
    );
    assert_eq!(
        crate::mem::align_of::<acuConfig>(),
        1usize,
        concat!("Alignment of ", stringify!(acuConfig))
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<acuConfig>())).reserved as *const _ as usize },
        0usize,
        concat!(
            "Offset of field: ",
            stringify!(acuConfig),
            "::",
            stringify!(reserved)
        )
    );
}
