#[doc = " DSP hook cookie."]
#[repr(C)]
#[derive(Debug, Copy, Clone)]
pub struct tag_dspHookCookie {
    #[doc = "< Next cookie."]
    pub next: *mut tag_dspHookCookie,
    #[doc = "< Hook callback."]
    pub callback: dspHookFn,
}
#[test]
fn bindgen_test_layout_tag_dspHookCookie() {
    assert_eq!(
        crate::mem::size_of::<tag_dspHookCookie>(),
        8usize,
        concat!("Size of: ", stringify!(tag_dspHookCookie))
    );
    assert_eq!(
        crate::mem::align_of::<tag_dspHookCookie>(),
        4usize,
        concat!("Alignment of ", stringify!(tag_dspHookCookie))
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<tag_dspHookCookie>())).next as *const _ as usize },
        0usize,
        concat!(
            "Offset of field: ",
            stringify!(tag_dspHookCookie),
            "::",
            stringify!(next)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<tag_dspHookCookie>())).callback as *const _ as usize },
        4usize,
        concat!(
            "Offset of field: ",
            stringify!(tag_dspHookCookie),
            "::",
            stringify!(callback)
        )
    );
}
