#[test]
fn bindgen_test_layout_NIM_TitleConfig() {
    assert_eq!(
        crate::mem::size_of::<NIM_TitleConfig>(),
        24usize,
        concat!("Size of: ", stringify!(NIM_TitleConfig))
    );
    assert_eq!(
        crate::mem::align_of::<NIM_TitleConfig>(),
        8usize,
        concat!("Alignment of ", stringify!(NIM_TitleConfig))
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<NIM_TitleConfig>())).titleId as *const _ as usize },
        0usize,
        concat!(
            "Offset of field: ",
            stringify!(NIM_TitleConfig),
            "::",
            stringify!(titleId)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<NIM_TitleConfig>())).version as *const _ as usize },
        8usize,
        concat!(
            "Offset of field: ",
            stringify!(NIM_TitleConfig),
            "::",
            stringify!(version)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<NIM_TitleConfig>())).unknown_0 as *const _ as usize },
        12usize,
        concat!(
            "Offset of field: ",
            stringify!(NIM_TitleConfig),
            "::",
            stringify!(unknown_0)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<NIM_TitleConfig>())).ratingAge as *const _ as usize },
        16usize,
        concat!(
            "Offset of field: ",
            stringify!(NIM_TitleConfig),
            "::",
            stringify!(ratingAge)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<NIM_TitleConfig>())).mediaType as *const _ as usize },
        17usize,
        concat!(
            "Offset of field: ",
            stringify!(NIM_TitleConfig),
            "::",
            stringify!(mediaType)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<NIM_TitleConfig>())).padding as *const _ as usize },
        18usize,
        concat!(
            "Offset of field: ",
            stringify!(NIM_TitleConfig),
            "::",
            stringify!(padding)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<NIM_TitleConfig>())).unknown_1 as *const _ as usize },
        20usize,
        concat!(
            "Offset of field: ",
            stringify!(NIM_TitleConfig),
            "::",
            stringify!(unknown_1)
        )
    );
}
