#[doc = " RSA context."]
#[repr(C)]
#[derive(Copy, Clone)]
pub struct psRSAContext {
    pub modulo: [u8_; 256usize],
    pub exponent: [u8_; 256usize],
    pub rsa_bitsize: u32_,
    pub unk: u32_,
}
#[test]
fn bindgen_test_layout_psRSAContext() {
    assert_eq!(
        crate::mem::size_of::<psRSAContext>(),
        520usize,
        concat!("Size of: ", stringify!(psRSAContext))
    );
    assert_eq!(
        crate::mem::align_of::<psRSAContext>(),
        4usize,
        concat!("Alignment of ", stringify!(psRSAContext))
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<psRSAContext>())).modulo as *const _ as usize },
        0usize,
        concat!(
            "Offset of field: ",
            stringify!(psRSAContext),
            "::",
            stringify!(modulo)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<psRSAContext>())).exponent as *const _ as usize },
        256usize,
        concat!(
            "Offset of field: ",
            stringify!(psRSAContext),
            "::",
            stringify!(exponent)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<psRSAContext>())).rsa_bitsize as *const _ as usize },
        512usize,
        concat!(
            "Offset of field: ",
            stringify!(psRSAContext),
            "::",
            stringify!(rsa_bitsize)
        )
    );
    assert_eq!(
        unsafe { &(*(crate::ptr::null::<psRSAContext>())).unk as *const _ as usize },
        516usize,
        concat!(
            "Offset of field: ",
            stringify!(psRSAContext),
            "::",
            stringify!(unk)
        )
    );
}
